\set db advice2pay

-- Create a carrier table that holds all of our carrier codes.
CREATE TABLE "Carrier"
(
  "CarrierCode" TEXT NOT NULL,
  "UserDescription" TEXT NOT NULL
);
ALTER TABLE "Carrier" OWNER TO :db;

-- Create a carrier table that holds english mappings to carrier code.
CREATE TABLE "CarrierMapping"
(
  "CarrierCode" TEXT NOT NULL,
  "UserDescription" TEXT NOT NULL
);
ALTER TABLE "CarrierMapping" OWNER TO :db;

-- The Carrier Column is no longer required.
update "MappingColumns" set "Required" = false where "Name" = 'carrier';

-- Add the db schema to support defaulting a column to a specific value.
ALTER TABLE "MappingColumns" ADD "DefaultValue" TEXT NULL;
ALTER TABLE "MappingColumns" ADD "ColumnName" TEXT NULL;
update "MappingColumns" set "DefaultValue" = 'Unspecified Carrier' where "Name" = 'carrier';
update "MappingColumns" set "ColumnName" = 'Carrier' where "Name" = 'carrier';

-- Add a CarrierCode to the CompanyCarrier table so we can see what carrier they told us this was.
ALTER TABLE "CompanyCarrier" ADD "CarrierCode" TEXT NULL;

